import { Container } from 'reactstrap'
import PropTypes from 'prop-types';

const BasePage = (props) => {
  const className = props.className || ''
  return (
    <div className={`base-page ${className}`}>
      <Container>
        {props.children}
      </Container>
    </div>
  )
}

BasePage

export default BasePage
